export class AAC {
    static FREQ: number[];
    static getRateIndexByRate(rate: any): number;
    static parseADTS(data: any, pts: any): {
        skip: number;
        remaining: any;
        frames: {
            pts: any;
            data: any;
        }[];
        samplingFrequencyIndex: number;
        sampleRate: number;
        objectType: number;
        channelCount: number;
        codec: string;
        config: number[];
        originCodec: string;
    };
    static parseAudioSpecificConfig(data: any): {
        samplingFrequencyIndex: number;
        sampleRate: number;
        objectType: number;
        channelCount: number;
        config: number[];
        codec: string;
        originCodec: string;
    };
    static getFrameDuration(rate: any, timescale?: number): number;
    static _getConfig(samplingIndex: any, channelCount: any, originObjectType: any): {
        config: number[];
        codec: string;
    };
    static getSilentFrame(codec: any, channelCount: any): Uint8Array;
}
